import { NavLink } from 'react-router-dom';

function EventsPage() {
  return (
    <div>
      <h1>Events Page</h1>
      <ul>
        <li>
          <NavLink>Event 1</NavLink>
        </li>
        <li>
          <NavLink>Event 2</NavLink>
        </li>
        <li>
          <NavLink>Event 3</NavLink>
        </li>
      </ul>
    </div>
  );
}

export default EventsPage;
